import React, { useState } from 'react';

function Dashboard() {
  const [scenarios, setScenarios] = useState({
    major: false,
    partial: false,
    well: false,
  });

  const [formData, setFormData] = useState({
    org_name: '',
    itsm_tools: '',
    observability_tools: '',
    service_names: '',
  });

  const [apiKey, setApiKey] = useState('');

  const handleCheckboxChange = (e) => {
    const { name, checked } = e.target;
    setScenarios({
      ...scenarios,
      [name]: checked,
    });
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // Build an array of selected scenarios
    const selectedScenarios = Object.entries(scenarios)
      .filter(([_, isSelected]) => isSelected)
      .map(([scenarioName]) => scenarioName);

    console.log('Selected scenarios:', selectedScenarios);
    console.log('Form data:', formData);
    console.log('API Key:', apiKey);

    // Example: Send data to your backend
  };

  return (
    <div style={{ maxWidth: '500px', margin: '0 auto', padding: '1rem' }}>
      <h1 className="mb-4">PD Demo Generator Dashboard</h1>

      <form onSubmit={handleSubmit}>
        {/* Scenarios */}
        <div className="mb-3">
          <label className="form-label" style={{ fontWeight: 'bold' }}>
            Scenarios
          </label>
          <div className="form-check">
            <input
              className="form-check-input"
              type="checkbox"
              id="majorScenario"
              name="major"
              checked={scenarios.major}
              onChange={handleCheckboxChange}
            />
            <label className="form-check-label" htmlFor="majorScenario">
              Major
            </label>
          </div>
          <div className="form-check">
            <input
              className="form-check-input"
              type="checkbox"
              id="partialScenario"
              name="partial"
              checked={scenarios.partial}
              onChange={handleCheckboxChange}
            />
            <label className="form-check-label" htmlFor="partialScenario">
              Partial
            </label>
          </div>
          <div className="form-check">
            <input
              className="form-check-input"
              type="checkbox"
              id="wellScenario"
              name="well"
              checked={scenarios.well}
              onChange={handleCheckboxChange}
            />
            <label className="form-check-label" htmlFor="wellScenario">
              Well
            </label>
          </div>
        </div>

        {/* Organization Name (required) */}
        <div className="mb-3">
          <label className="form-label" htmlFor="org_name">
            Organization Name <span style={{ color: 'red' }}>*</span>
          </label>
          <input
            type="text"
            className="form-control"
            id="org_name"
            name="org_name"
            value={formData.org_name}
            onChange={handleInputChange}
            required
          />
        </div>

        {/* ITSM Tools */}
        <div className="mb-3">
          <label className="form-label" htmlFor="itsm_tools">
            ITSM Tools
          </label>
          <input
            type="text"
            className="form-control"
            id="itsm_tools"
            name="itsm_tools"
            value={formData.itsm_tools}
            onChange={handleInputChange}
          />
        </div>

        {/* Observability Tools */}
        <div className="mb-3">
          <label className="form-label" htmlFor="observability_tools">
            Observability Tools
          </label>
          <input
            type="text"
            className="form-control"
            id="observability_tools"
            name="observability_tools"
            value={formData.observability_tools}
            onChange={handleInputChange}
          />
        </div>

        {/* OpenAI API Key */}
        <div className="mb-3">
          <label className="form-label" htmlFor="api_key_global">
            OpenAI API Key
          </label>
          <input
            type="password"
            className="form-control"
            id="api_key_global"
            placeholder="Enter your OpenAI API key"
            value={apiKey}
            onChange={(e) => setApiKey(e.target.value)}
          />
        </div>

        <button type="submit" className="btn btn-primary w-100">
          Generate Scenario(s)
        </button>
      </form>
    </div>
  );
}

export default Dashboard;
